class Home extends Component {
  render() {
    return (
      <Section className="container-fluid bg-dark ">
        <div className="container">
          <ColumnLeft clasName="bg-dark">
            {" "}
            <motion.figure
              class="text-center"
              animate={{ scale: [8, 0.5] }}
              transition={{ duration: 0.9 }}
            >
              <h2 class="display-4">Suman Karanjit</h2>
              <h4 class=" " style={{ color: "#6c757d" }}>
                Software Developer
              </h4>
            </motion.figure>
          </ColumnLeft>

          <div class="row">
            <div class="col-8">col-8</div>
            <div class="col-4">col-4</div>
          </div>
        </div>
      </Section>
    );
  }
}

export default Home;
